                        "Desc": "人々の心の声を、高天の神座まで届かせる。<br><color style='color:#FFD780;'>マーヴィカの元素爆発は元素エネルギーによるものではなく、「戦意」によるものとなる。</color><br><br><color style='color:#FFD780;'>戦意</color><br>マーヴィカの戦意が50%以上の時、マーヴィカはすべての戦意を消費し、元素爆発を発動できる。<br>マーヴィカは以下の方法で戦意を獲得する。<br>・戦闘状態にある時、付近にいるチーム内キャラクターが消費した夜魂値はマーヴィカの戦意に変換される。<br>・付近にいるチーム内キャラクターの通常攻撃が敵に命中した時、マーヴィカは戦意を1.5獲得する。この効果は0.1秒毎に1回のみ発動可能。<br><br>発動後、マーヴィカは夜魂値を10獲得し、夜魂の加護状態に入る。さらに、双駆輪に乗って空中に跳び上がり、地面にいる敵に強力な墜日斬りを1回発動し、夜魂性質の<color style='color:#FF9999;'>炎元素範囲ダメージ</color>を与え、「死生の炉」状態に入る。<br><br><color style='color:#FFD780;'>死生の炉</color><br>継続期間中、マーヴィカの各種行動は夜魂値を消費しなくなり、マーヴィカの中断耐性がアップする。同時に、元素爆発を発動時の戦意を基に、墜日斬りおよび双駆輪状態での通常攻撃と重撃の与えるダメージをアップする。<br>死生の炉状態はマーヴィカの退場時に解除される。<br><br><i>「——しかし此度の戦いで、その運命を打ち破りたいのだ。」</i>JP0B",
