                        "Desc": "「闘争」の権能を借り、人神が受け継ぐ「諸火武装」を召喚し、夜魂性質の<color style='color:#FF9999;'>炎元素ダメージ</color>を与える。<br>発動後、マーヴィカは夜魂値を上限まで回復し、夜魂の加護状態に入る。<br><br><color style='color:#FFD780;'>諸火武装</color><br>一回押しと長押しによって、形態の異なる諸火武装を解放する。<br><br><color style='color:#FFD780;'>一回押し</color><br>「神名解放」：諸火武装は焚曜の輪の形態で顕現する。焚曜の輪はフィールド上キャラクターに追従し、一定時間ごとに周囲の敵を攻撃し、夜魂性質の<color style='color:#FF9999;'>炎元素ダメージ</color>を与える。<br><br><color style='color:#FFD780;'>長押し</color><br>「古名解放」：諸火武装は双駆輪の形態で顕現する。この状態にある時、マーヴィカは双駆輪を操縦して高速移動したり、双駆輪に隠されている予備の推進モジュールをオンにし、各種地形を一時的に駆け抜けたり、空中を一時的に滑翔したりできる。同時に、マーヴィカの通常攻撃、重撃、落下攻撃ダメージは元素付与によって他の元素に変化しない夜魂性質の<color style='color:#FF9999;'>炎元素ダメージ</color>へと変わる。ダッシュすると、経路上の敵にも夜魂性質の<color style='color:#FF9999;'>炎元素ダメージ</color>を与える。<br><br>夜魂の加護状態にある時、元素スキルボタンを一回押しすると、諸火武装の形態を切り替えられる。諸火武装はマーヴィカの夜魂の加護状態が終了すると消える。夜魂値が尽きた時、マーヴィカの夜魂の加護状態は終了する。<br><br><i>もしマーヴィカに、双駆輪に似たものは他の世界では、標識としてナンバープレートを付ける必要があると伝えたら、彼女はそれでも歓喜をあげてこう言うだろう——<br>「ふふ、この世で唯一のものだから、ナンバー選び放題なのでは？」</i>JP0B",
